import React from 'react';

const languages = [
    { code: 'en', name: 'Engelska', flag: '游섫릖' },
    { code: 'sv', name: 'Svenska', flag: '游젏릖' },
    { code: 'es', name: 'Spanska', flag: '游쀯릖' },
    { code: 'fr', name: 'Franska', flag: '游游' },
    { code: 'de', name: 'Tyska', flag: '游뾇릖' }, // Nytt spr친k
    { code: 'zh', name: 'Kinesiska', flag: '游뻟릖' }, // Nytt spr친k
  ];


const LanguageSelector = ({ onSelect }) => {
  return (
    <div style={{ display: 'flex', justifyContent: 'center', flexWrap: 'wrap' }}>
      {languages.map((language) => (
        <div
          key={language.code}
          style={{ border: '1px solid #ccc', padding: '10px', margin: '10px', borderRadius: '8px', textAlign: 'center', cursor: 'pointer' }}
          onClick={() => onSelect(language.code)}
        >
          <div style={{ fontSize: '40px' }}>{language.flag}</div>
          <h3>{language.name}</h3>
        </div>
      ))}
    </div>
  );
};

export default LanguageSelector;
